package com.example.antriankesehatan.modelimport com.google.gson.annotations.SerializedNamedata class CurrentAntrianResponse(	@field:SerializedName("data")	val data: List<DataItemCurrentAntrian?>? = null,	@field:SerializedName("meta")	val meta: MetaCurrentAntrian? = null)data class MetaCurrentAntrian(	@field:SerializedName("code")	val code: Int? = null,	@field:SerializedName("message")	val message: String? = null,	@field:SerializedName("status")	val status: String? = null)data class DataItemCurrentAntrian(	@field:SerializedName("jam_praktek")	val jamPraktek: Any? = null,	@field:SerializedName("antrian")	val antrian: String? = null,	@field:SerializedName("dokter")	val dokter: Dokter? = null,	@field:SerializedName("dokter_id")	val dokterId: Int? = null)data class Dokter(	@field:SerializedName("bidang_dokter")	val bidangDokter: String? = null,	@field:SerializedName("code")	val code: String? = null,	@field:SerializedName("updated_at")	val updatedAt: String? = null,	@field:SerializedName("nama_dokter")	val namaDokter: String? = null,	@field:SerializedName("created_at")	val createdAt: String? = null,	@field:SerializedName("id")	val id: Int? = null,	@field:SerializedName("photo_dokter")	val photoDokter: String? = null)